description.text:
I modified the openSCAD file of the &quot;Customizable Replicator Spool Holder with Filament Guide.&quot;  
I removed the filament guide as it didn't make sense with the Bowden-driven Eventorbot.  
But if necessary, cranking the &quot;spool diameter&quot; variable up, and printing the filament guide from the &quot;Customizable Replicator Spool Holder with FIlament Guide&quot; should work fine.

